//Difficulty Reader
function getDifficultyFromMCPESettings(){
    var file = new java.io.File("/sdcard/games/com.mojang/minecraftpe/options.txt");
    var br = new java.io.BufferedReader(new java.io.InputStreamReader(new java.io.FileInputStream(file)));
    var read, dif;
    while((read = br.readLine()) != null) {
        if(read.split(":")[0] == "game_difficulty_new") {
            dif = read.split(":")[1];
            break;
        }
    }
    br.close();
    return dif;
}

//Sound Reader
function getVolumeFromMCPESettings(){
    var file = new java.io.File("/sdcard/games/com.mojang/minecraftpe/options.txt");
    var br = new java.io.BufferedReader(new java.io.InputStreamReader(new java.io.FileInputStream(file)));
    var read, vol;
    while((read = br.readLine()) != null) {
        if(read.split(":")[0] == "audio_sound") {
            vol = read.split(":")[1];
            break;
        }
    }
    br.close();
    return vol;
}

